func init() {
	filePathToDecompressedData, err := decompressFiles(filePathToData)
	if err != nil {
		panic(err.Error())
	}
	readBucket, err := storagemem.NewReadBucket(filePathToDecompressedData)
	if err != nil {
		panic(err.Error())
	}
	ReadBucket = readBucket
}

// Exists returns true if the given path exists in the static data.
//
// The path is normalized within this function.
func Exists(filePath string) bool {
	_, ok := filePathToData[normalpath.Normalize(filePath)]
	return ok
}

// FileImports gets the imports for the given file path, if the file path exists.
func FileImports(filePath string) ([]string, bool) {
	imports, ok := filePathToImports[filePath]
	if !ok {
		return nil, false
	}
	c := make([]string, len(imports))
	copy(c, imports)
	return c, true
}

// MessageFilePath gets the file path for the given message, if the message exists.
func MessageFilePath(messageName string) (string, bool) {
	filePath, ok := messageNameToFilePath[messageName]
	return filePath, ok
}

// EnumFilePath gets the file path for the given enum, if the enum exists.
func EnumFilePath(enumName string) (string, bool) {
	filePath, ok := enumNameToFilePath[enumName]
	return filePath, ok
}

func decompressFiles(fileToData map[string][]byte) (map[string][]byte, error) {
	fileToDecompressedData := make(map[string][]byte, len(fileToData))
	for name, compressed := range fileToData {
		decompressor, err := gzip.NewReader(bytes.NewReader(compressed))
		if err != nil {
			return nil, fmt.Errorf("could not initialize decompressor for %q: %w", name, err)
		}
		decompressed, err := io.ReadAll(decompressor)
		if err != nil {
			return nil, fmt.Errorf("could not decompress %q: %w", name, err)
		}
		fileToDecompressedData[name] = decompressed
	}
	return fileToDecompressedData, nil
}
